import styled from "@emotion/styled";
import { GoArrowUp } from "react-icons/go";

const Styled = styled.div`
  svg {
    fill: ${props.isClicked ? "#757575" : "#9b9b9b"};
    cursor: pointer;
  }
`;

function Vote(props) {
  return (
    <Styled>
      <GoArrowUp />
    </Styled>
  );
}

export default Vote;
